import React, { useState } from "react";
import { useNavigate, useLocation } from "react-router-dom";
import Tips from "../../assets/images/bulbe.png";
import { ProgressBar } from "primereact/progressbar";
import { RadioButton } from "primereact/radiobutton";
import "./style.css";

export default function Index() {
  const [selectedOption, setSelectedOption] = useState("");
  const [currentQuestion, setCurrentQuestion] = useState(0);
  const [answers, setAnswers] = useState({});
  const navigate = useNavigate();
  const location = useLocation();
  const cvResultData = location.state?.responseData || [];

  const questions = [
    {
      id: 1,
      text: "I enjoy trying out new things, even if they feel a bit weird or different.",
      trait: "Openness",
      description:
        "This trait reflects how open you are to new experiences, ideas, and unconventional ways of thinking.",
    },
    {
      id: 2,
      text: "I like thinking about deep stuff like life, people, or how the world works.",
      trait: "Openness",
      description:
        "This trait reflects how open you are to new experiences, ideas, and unconventional ways of thinking.",
    },
    {
      id: 3,
      text: "I do creative things in my free time like drawing, writing, editing, or designing.",
      trait: "Openness",
      description:
        "This trait reflects how open you are to new experiences, ideas, and unconventional ways of thinking.",
    },
    {
      id: 4,
      text: "I like to keep things organized, like my plans, my notes, or my workspace.",
      trait: "Conscientiousness",
      description:
        "This trait reflects how organized, dependable, and self-disciplined you are. It relates to your ability to plan ahead, follow rules, and stay focused on goals.",
    },
    {
      id: 5,
      text: "I double-check things to make sure I haven’t made a mistake.",
      trait: "Conscientiousness",
      description:
        "This trait reflects how organized, dependable, and self-disciplined you are. It relates to your ability to plan ahead, follow rules, and stay focused on goals.",
    },
    {
      id: 6,
      text: "If I start something like a project or assignment, I always try to finish it properly.",
      trait: "Conscientiousness",
      description:
        "This trait reflects how organized, dependable, and self-disciplined you are. It relates to your ability to plan ahead, follow rules, and stay focused on goals.",
    },
    {
      id: 7,
      text: "I feel confident talking to new people or starting a conversation.",
      trait: "Extraversion",
      description:
        "This trait reflects how outgoing, energetic, and socially confident you are. It indicates how much you enjoy being around people and engaging in social activities.",
    },
    {
      id: 8,
      text: "I feel active and energized when I’m around others.",
      trait: "Extraversion",
      description:
        "This trait reflects how outgoing, energetic, and socially confident you are. It indicates how much you enjoy being around people and engaging in social activities.",
    },
    {
      id: 9,
      text: "I do creative things in my free time like drawing, writing, editing, or designing.",
      trait: "Extraversion",
      description:
        "This trait reflects how outgoing, energetic, and socially confident you are. It indicates how much you enjoy being around people and engaging in social activities.",
    },
    {
      id: 10,
      text: "I usually try to help people, even if I’m busy.",
      trait: "Agreeableness",
      description:
        "This trait reflects how cooperative, compassionate, and empathetic you are towards others. It shows your tendency to prioritize harmony and get along well with others.",
    },
    {
      id: 11,
      text: "I enjoy working with others and sharing ideas in a team.",
      trait: "Agreeableness",
      description:
        "This trait reflects how cooperative, compassionate, and empathetic you are towards others. It shows your tendency to prioritize harmony and get along well with others.",
    },
    {
      id: 12,
      text: "I care about people’s feelings and try not to hurt them.",
      trait: "Agreeableness",
      description:
        "This trait reflects how cooperative, compassionate, and empathetic you are towards others. It shows your tendency to prioritize harmony and get along well with others.",
    },
    {
      id: 13,
      text: "I get stressed out easily, even for small things like delays or deadlines.",
      trait: "Neuroticism",
      description:
        "This trait reflects how you respond to stress, emotional instability, and negative emotions. Lower neuroticism means you tend to stay calm and resilient under pressure.",
    },
    {
      id: 14,
      text: "When something goes wrong, I find it hard to stay calm.",
      trait: "Neuroticism",
      description:
        "This trait reflects how you respond to stress, emotional instability, and negative emotions. Lower neuroticism means you tend to stay calm and resilient under pressure.",
    },
    {
      id: 15,
      text: "I sometimes overthink things and feel anxious without a clear reason.",
      trait: "Neuroticism",
      description:
        "This trait reflects how you respond to stress, emotional instability, and negative emotions. Lower neuroticism means you tend to stay calm and resilient under pressure.",
    },
  ];

  const options = [
    { value: "01", label: "Strongly Disagree", color: "#2563eb", score: "1" },
    { value: "02", label: "Disagree", color: "#6b7280", score: "2" },
    { value: "03", label: "Neutral", color: "#6b7280", score: "3" },
    { value: "04", label: "Agree", color: "#6b7280", score: "4" },
    { value: "05", label: "Strongly agree", color: "#6b7280", score: "5" },
  ];

  const handleOptionChange = (value) => {
    setSelectedOption(value);
  };

  const handleNextQuestion = () => {
    if (selectedOption) {
      const selectedOptionObj = options.find(
        (opt) => opt.value === selectedOption
      );
      const updatedAnswers = {
        ...answers,
        [questions[currentQuestion].id]: {
          score: parseInt(selectedOptionObj.score),
          trait: questions[currentQuestion].trait,
        },
      };

      setAnswers(updatedAnswers);

      if (currentQuestion < questions.length - 1) {
        setCurrentQuestion(currentQuestion + 1);
        setSelectedOption("");
      } else {
        const traitScores = {};
        Object.values(updatedAnswers).forEach(({ score, trait }) => {
          traitScores[trait] = (traitScores[trait] || 0) + score;
        });

        const finalResults = Object.entries(traitScores).map(
          ([trait, score]) => {
            const percentage = (score / 15) * 100;
            return {
              trait,
              score: Math.round(percentage),
            };
          }
        );
        navigate("/personality-traits-result", {
          state: { results: finalResults, responseData: cvResultData },
        });
      }
    }
  };

  const progressValue = ((currentQuestion + 1) / questions.length) * 100;
  const currentQuestionData = questions[currentQuestion];

  return (
    <div>
      <div className="personalityTraitsQuestionContainer">
        <div className="personalityTraitsQuestionContenet">
          <div className="personalityTraitsQuestionContenetLeft">
            <div className="personalityTraitsQuestionContenetLeftBoxOne">
              <div className="personalityTraitsQuestionContenetLeftTitle">
                <span>Discover Your Personality Traits</span>
              </div>
              <div className="tipsText">
                <span>
                  <img src={Tips} alt="tips" className="tips" />
                  &nbsp;&nbsp;Trait : {currentQuestionData.trait}
                </span>
              </div>
              <div className="tipsDescription">
                <span>{currentQuestionData.description}</span>
              </div>
            </div>
            <div className="questionIdentify">
              <div className="questionCount">
                <span>
                  Questions {currentQuestion + 1} of {questions.length}
                </span>
              </div>
              <div className="progressBar">
                <ProgressBar
                  value={progressValue}
                  showValue={false}
                  className="progressBarStyle"
                />
              </div>

              <div className="survey-container">
                <div className="question-header">
                  <div className="question-text">
                    <span>
                      {currentQuestionData.id}. {currentQuestionData.text}
                    </span>
                  </div>
                </div>

                <div className="options-container">
                  {options.map((option) => (
                    <div
                      key={option.value}
                      className={`option-item ${
                        selectedOption === option.value ? "selected" : ""
                      }`}
                      onClick={() => handleOptionChange(option.value)}
                    >
                      <div className="option-number">{option.value}</div>
                      <div className="option-label">{option.label}</div>
                      <div className="radio-button-wrapper">
                        <RadioButton
                          inputId={option.value}
                          name="survey"
                          value={option.value}
                          onChange={(e) => handleOptionChange(e.value)}
                          checked={selectedOption === option.value}
                        />
                      </div>
                    </div>
                  ))}
                </div>
              </div>
              <div className="nextQuestionButton" onClick={handleNextQuestion}>
                <span>
                  {currentQuestion === questions.length - 1
                    ? "Finish Test"
                    : "Next Question"}{" "}
                  &gt;
                </span>
              </div>
            </div>
          </div>
          <div className="personalityTraitsQuestionContenetRight">
            <div class="stepper-container">
              <div class="step active">
                <div class="step-number">1</div>
                <div class="step-label">
                  <strong style={{ color: "#9B9BA0" }}>Upload CV</strong>
                </div>
              </div>
              <div class="step active">
                <div class="step-number">2</div>
                <div class="step-label">Personality Test</div>
              </div>
              <div class="step">
                <div class="step-number">3</div>
                <div class="step-label">Interest Identification</div>
              </div>
              <div class="step">
                <div class="step-number">4</div>
                <div class="step-label">Skill identification</div>
              </div>
              <div class="step">
                <div class="step-number">5</div>
                <div class="step-label">Results</div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
